public class Repeated_String_Match {
    public int repeatedStringMatch(String A, String B) {
        int repeated = 1;
        StringBuilder mix = new StringBuilder(A);
        while (!mix.toString().contains(B)) {
            if (mix.length() - A.length() > B.length()) {
                return -1;
            }
            repeated++;
            mix.append(A);
        }
        return repeated;
    }

    public int repeatedStringMatch1(String A, String B) {
        if (A.contains(B)) {
            return 1;
        }
        if (!B.contains(A)) {
            String mix = A + A;
            if (mix.contains(B)) {
                return 2;
            }
            return -1;
        }
        int repeated = 0;
        while (B.contains(A)) {
            B = B.replaceFirst(A, "");
            repeated++;
        }
        if (B.length() == 0) {
            return repeated;
        } else if (A.endsWith(B) || A.startsWith(B)) {
            repeated++;
        } else {
            String mix = A + A;
            if (!mix.contains(B)) {
                return -1;
            }
            int index = mix.indexOf(B);
            if (index + B.length() < A.length()) {
                return -1;
            }
            repeated += 2;
        }
        return repeated;
    }

    public static void main(String[] args) {
        /**
         * case 0 abcd  cdabcdab
         * case 1  bb   bbbbbbb"
         * case 2  aaaaaaaaaaaaaaaaaaaaaab ba
         * case 3  aa a
         * case 4  abcd cdabcdvvabcdab
         * case 5    
         */
        Repeated_String_Match item = new Repeated_String_Match();
        System.out.println(item.repeatedStringMatch("", ""));
    }
}
